As a first step, we might like to look instead this binary black box of a Component and see what it actually does. To do this, we can use jco wit to extract the "WIT world" of the Component ( WIT is the typing language used for defining Components). > jco wit cowsay.wasm
world cowsay { export cow: interface { enum cows { default, cheese, daemon, dragon-and-cow, dragon, elephant-in-snake, elephant, eyes, flaming-sheep } say: func(text: string, cow: option<cows>) -> string; }
} From the above we can see that this Component exports a cow interface with a single function export, say, taking as input a string, an optional cow, and returning a string. Alternatively jco print cowsay.wasm -o out.wat would output the full concrete Wasm WAT to inspect the Component, with all the implementation details (don't forget the -o flag...).
